import * as React from 'react';
import { NavLink } from 'react-router-dom';
import Main from './Main'

import './App.css'




const gameCatalog = ["The Legend of Zelda: Ocarina of Time",
"Tony Hawk's Pro Skater 2",
"Grand Theft Auto IV",
"Soul Calibur",
"Super Mario Galaxy",
"Super Mario Galaxy 2",
"Red Dead Redemption 2",
"Grand Theft Auto V",
"Persona 5 Royal",
"Disco Elysium"
];
let gamePrint = [];

for(let i = 0; i <= gameCatalog[9].length;i++){
  gamePrint.push(<input type= "text" maxlength = "1"/>)
}
function testApp() {
  
  return (
    <>
   
      <h2>TESTING Make boxes from length of the string</h2>
      <form className = "tree">
        {gamePrint}
      </form>
    </>
  );
}






const App = () => (
  <div classname='app'>
    <h1>VGWordle</h1>
    <Navigation />
    <Main />
    
  </div>

  
);


const Navigation = () => (
  <nav>
    <ul>
      <li><NavLink end className= {({isActive}) => isActive ? 'current' : undefined}  to='/'>Home</NavLink></li>
      <li><NavLink end className={({isActive}) => isActive ? 'current' : undefined} to='/catalog'>Catalog</NavLink></li>
      <li><NavLink end className={({isActive}) => isActive ? 'current' : undefined} to='/game'>Game Test</NavLink></li>
    </ul>
  </nav>
);



export default App;
